import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const currdate = new Date().getHours();

const ohayo = ""
const cssFree = {}

if (currdate >= 1 && currdate < 12){
  ohayo = "Good Morning"
  cssFree.color = "red"
}else if (currdate >= 12 && currdate <= 19 ){
  ohayo = "Good Evening"
  cssFree.color = "yellow"
}else {
  ohayo = "Good Night"
  cssFree.color = "blue"
}

ReactDOM.render(
  <div> 
  <h1>  Hello <span style={cssFree}> {ohayo} </span> </h1>
  </div>,

  document.getElementById('root')
);

